import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import Protected from './components/Protected';
import { AuthContextProvider } from './context/AuthContext';
import Account from './pages/Account';
import Home from './pages/Home';
import Signin from './pages/Signin';
import TryFavoris from "./pages/TryFavoris";
import Spanish from "./components/Spanish"
import French from "./components/French";
import Portuguese from "./components/Portuguese";
import Navbar from "./components/Navbar";
import Footer from "./components/footer";



function App() {
  return (
    <div>
      <AuthContextProvider>
        <Navbar />
          <Routes>
              <Route path='/' element={<Signin />} />
              <Protected path='/Home' element={<Home />} />
              <Protected path="/Spanish" element={<Spanish />} />
              <Protected path="/French" element={<French />} />
              <Protected path="/Portuguese" element={<Portuguese />} />
              <Protected path='/account' element={<Account />} />
              <Route path='*' element={<Navigate to='/' />} />
          </Routes>

      </AuthContextProvider>
      <Footer />
    </div>
  );
}

export default App;
